// import './ExpenseDetail.css';

function ExpenseDetail(props) {
	const title = props.title.value();
	const amount = props.amount.value();
	const date = props.date;

	return (
		<div>
			<div>{title}</div>
			<div>{amount}</div>
			<div>{date}</div>
		</div>
	);
}

export default ExpenseDetail;
